// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.6.0 <0.9.0;

contract Enum{
    //Define a Enum 
    enum winner {yes, no, notSure}

    winner public person = winner.yes;
    uint public amount = 100;

    function checkwinner() public{
        if(person == winner.yes){
            amount = 0;
        }
    }
}

